import React, { Component } from "react";
import Slider from "./Slider";

class PlacePicker extends Component {
  render() {
    return (
      <div>
        <h3>Place of Interest</h3>

        <input type="range" min="0" max="1000" onChange={this.props.onSetRadius}></input>
        <input
          type="text"
          placeholder="Ignore for no POI"
          onChange={(e) => this.props.onSetPOI(e.target.value)}
        />
      </div>
    );
  }
}

export default PlacePicker;
